export default function DialogPassword() {

	const color = 'rgb(255, 0, 0)'

	return (
		<dialog 
			className='modal'
			open={true}
			style={{
				backgroundColor: 'rgb(230, 230, 230)',
				width: '400px',
				textAlign: 'left'
			}}
		>

			<div 
				style={{
					display: 'flex',
				}}
			>
				<svg height="20" viewBox="0 -960 960 960"><path d="M440-280h80v-240h-80v240Zm40-320q17 0 28.5-11.5T520-640q0-17-11.5-28.5T480-680q-17 0-28.5 11.5T440-640q0 17 11.5 28.5T480-600Zm0 520q-83 0-156-31.5T197-197q-54-54-85.5-127T80-480q0-83 31.5-156T197-763q54-54 127-85.5T480-880q83 0 156 31.5T763-763q54 54 85.5 127T880-480q0 83-31.5 156T763-197q-54 54-127 85.5T480-80Zm0-80q134 0 227-93t93-227q0-134-93-227t-227-93q-134 0-227 93t-93 227q0 134 93 227t227 93Zm0-320Z"/></svg>
				<p style={{ height: '100%', fontSize: '19px', margin: 'auto', marginLeft: '5px' }}>Info</p>
			</div>

			Das Passwort muss zwischen 8 und 128 Zeichen lang sein.<br/><br/>
			Erlaubt sind:<br/>
			<span style={{ color: color }}>Kleinbuchstaben, Gro√üuchstaben, Zahlen und diese Zeichen:</span><br/>
			<span aria-label='exclamation mark'>!</span> <span aria-label='at symbol'>@</span> <span aria-label='hashtag'>#</span> <span aria-label='dollar sign'>$</span> <span aria-label='percent'>%</span>
			
		</dialog>
	)

}
